import Navbar from './Components/Navbar'
import Footer from './Components/Footer'
import UserJob from './Components/UserJob'
import aswinImage from './static/images/aswin.jpg'
import { useEffect } from 'react';
import axios from 'axios';

function App() {

  useEffect(() => {
    const username = 'aswinrprasad';
    const password = '11ffc06e2cc9962d0b57d41551132a8256';
    var basicAuth = 'Basic ' + btoa(username + ':' + password);
    axios.get("http://192.168.18.139:8080/api/json?tree=jobs[name,description,url]", {}, {
      headers: { 'Authorization': + basicAuth }
    })
    .then((res) => {
      console.log(res.data)
    })
    .catch((err) => console.log(err))
  }, [])
  return (
    <div className="main">
      <Navbar />
      <div className="container">
        <div className="row">
          <div className="col-3">
            <UserJob jobname="Job 1" profileImage={aswinImage} />
          </div>
          <div className="col-3">
            <UserJob jobname="Job 2" />
          </div>
          <div className="col-3">
            <UserJob jobname="Job 3" />
          </div>
          <div className="col-3">
            <UserJob jobname="Job 4" />
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
}

export default App;
